"use strict";function newFunction(){$.each($(".nav-tabs .active"),function(){history.replaceState(null,null,"/");var t=document.location.href+this.id;history.pushState(this.id,"",t)})}$(".btnNext").click(function(){$(".nav-tabs .active").parent().next("li").find("a").trigger("click"),newFunction()}),$(".btnPrevious").click(function(){$(".nav-tabs .active").parent().prev("li").find("a").trigger("click"),newFunction()});